import { useEffect, useState } from "react";

function EmpList(){
    const [data,setData]=useState(null)
    useEffect(()=>{
        fetch("http://localhost:3006/Employe")
        .then((resp)=>{
            return resp.json()
        })
        .then((res)=>{
            console.log(res)
            setData(res)
        })
    })
    return(
        <div className="container">
            <div className="card">
                <div className="card-title">
                    <h3>Employee Management system</h3>

                </div>
                <div className="card-body">
                    <table className="table table-bordred">
                        <thead className="bg-dark text-white">
                            <tr>
                                <th>Id</th>
                                <th>Name</th>
                                <th>Email</th>
                                <th>Mobile</th>
                                <th>Salary</th>
                                <th>Actions</th>
                            </tr>
                        </thead>
                        <tbody>
{data.map(item=>{
    <tr>
        <td>{item.id}</td>
        <td>{item.name}</td>
        <td>{item.email}</td>
        <td>{item.mobile}</td>
        <td>{item.salary}</td>
    </tr>
})}
                        </tbody>

                    </table>
                </div>

            </div>

        </div>
    )
}
export default EmpList;
